import React from 'react'

const imageSearch = (props) => {
    return (
    //     <div class="flex justify-center">
    //         <div>
    //             <form class="flex items-center" onSubmit={props.handleGetRequest}>
    //                 <input type="search" class="bg-gray-50 border border-gray-300 text-gray-900 text-sm rounded-lg focus:ring-blue-500 focus:border-blue-500 block w-full pl-10 p-2.5" autoComplete="off" name="searchValue" placeholder="Image search"/>
    //                 <button type="button" >Click here to search</button>
    //             </form>
    //         </div>
    //     </div>
        <div class="flex justify-center">
            <div class="mb-3 xl:w-96">
                <div class="input-group relative flex flex-wrap items-stretch w-full mb-4">
                    <input type="search" class="form-control relative flex-auto min-w-0 block w-full px-3 py-1.5 text-base font-normal text-gray-700 bg-white bg-clip-padding border border-solid border-gray-300 rounded transition ease-in-out m-0 focus:text-gray-700 focus:bg-white focus:border-blue-600 focus:outline-none" placeholder="Search for images..." aria-label="Search" aria-describedby="button-addon3" autoComplete="off" name="searchValue"/>
                    <button class="btn px-6 py-2 border-2 border-blue-600 text-blue-600 font-medium text-xs leading-tight uppercase rounded hover:bg-black hover:bg-opacity-5 focus:outline-none focus:ring-0 transition duration-150 ease-in-out" type="button" id="button-addon3">Click to search</button>
                </div>
            </div>
        </div>
    )
}

export default imageSearch
